import React from 'react'

export function PerfilUsuario({Perfil}) {
  return (
    <>
    <div className='flex justify-center mb-6 mt-2'>
       <div><img src={Perfil.url_imagen} alt='Imagen de perfil' className='rounded-full mt-2 mb-2 hover:bg-fuchsia-600'/></div>
    </div>
    <div className='flex justify-center text-3xl mt-3 mb-6'>Nombre de Usuario<br></br>{Perfil.nombre_usuario}</div>

    
    </>
  )
}
